description:
Xuân La, 221MX8TX8MT, thang máy, Setup nội thất nhập khẩu đầy đủ. Giá 68 tỷ.
Mô tả: 
+ Tòa nhà nằm ngay trung tâm quận Tây Hồ, được xây dựng 8 tầng thang máy. Nội thất được nhập khẩu và đã setup đầy đủ hoàn chỉnh cho một căn hộ dịch vụ cao cấp. 
+ Thửa đất vuông vắn có Vị trí vô cùng Đắc Địa, thông tứ tung đi lại Xuân La - Võ Chí Công, thông Lạc Long Quân, ra Hồ Tây rất gần, giao thông thuận tiện đi sân bay QT Nội Bài, các Tỉnh/ TP trong cả nước.
+ Nhà xây mới, đẹp, hiện đại vừa ở vừa làm căn hộ dịch vụ cao cấp cho người nước ngoài thuê. Full nội thất hiện đại, nhập khẩu cao cấp. Doanh thu cho thuê 100 triệu/ tháng.
*Thiết kế gồm 2 khối nhà:
+ Khối mặt tiền 2 tầng cho thuê văn phòng công ty;
+ Khối nhà 8 tầng, gồm:
- Tầng 1: Gara nhiều ô tô + xe máy;
- Tầng 2: Phòng khách, Bếp ăn, phòng ngủ, WC;
- Tầng 3: 03 phòng ngủ, WC khép kín;
- Tầng 4,5,6 mỗi tầng 2 căn hộ cao cấp khép kín;
- Tầng 7: 01 căn hộ cao cấp khép kín. Sân vườn có thể cải tạo thành 1 căn hộ;
-  Tầng 8: Tum + Sân vườn có mái che trước sau rộng;
 P/s: Hiện tại phần đất xây toà nhà 8 tầng được cấp sổ là 173m2, còn phần nhà 2 tầng mặt tiền 48m2 đủ điều kiện đính chính bổ sung cấp sổ.
+ Sổ đỏ, pháp lý chuẩn, giao dịch ngay. Có thương lượng. Xin liên hệ em Vĩ Đại để xem nhà đất. Miễn trung gian. Mang giá trị sự an tâm và hài lòng cho quý khách!
